import React from "react";
import ReactDOM from 'react-dom';
import './index.css';

import{
BrowserRouter as Router,
Routes,
Route,
} from "react-router-dom"

import OfertAdd from "./Ofert/OfertAdd"
import CategoriesAdd from "./Category/CategoriesAdd"
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./Category/CategoryOption";
import OfertSelect from "./Ofert/OfertSelect";
import Navbar from "./Navbar";

function App(){

    return(

      <Router>
        <Navbar /><Hello login="studencie" /> 
        <Routes>
          <Route exact path='/' element={<div><OfertSelect /></div>} />
          <Route path={'/Dom'} element={<CategoryOption /> } />
          <Route path={'/api/login'} element={<div><Login /></div> } />
          <Route path={'/api/register'} element={<div><Register /></div> } />
          <Route path={'/Ofert'} element={<div><OfertAdd /><OfertSelect /></div> } />
          <Route path={'/Category'} element={<div><CategoriesAdd /><CategoryOption /></div> } />
          <Route path='*' element={<Error /> } />
        </Routes>
        </Router>);


  }

ReactDOM.render(<App/>,document.getElementById('root'));
